function bootstrap_GACountyOverlay()
{
  var bGreasemonkeyServiceDefined = false;

  try {
    bGreasemonkeyServiceDefined = (typeof Components.interfaces.gmIGreasemonkeyService === "object");
  }
  catch (err) { /* Ignore */ }

  if (typeof unsafeWindow === "undefined" || ! bGreasemonkeyServiceDefined) {
    unsafeWindow    = ( function () {
      var dummyElem = document.createElement('p');
      dummyElem.setAttribute('onclick', 'return window;');
      return dummyElem.onclick();
    }) ();
  }

    /* begin running the code! */
    setTimeout(InitGACountyOverlay, 1000);
}

function AddCountyPolygon(countyLayer,countyPoints,countyColor,countyNumber){
    
    var gac_Map = unsafeWindow.Waze.map;
    var gac_OL = unsafeWindow.OpenLayers;
    var countyNameLabel = countyNumber;
    var countyName = countyNumber;
    
    var style = {
        strokeColor: countyColor,
        strokeOpacity: .5,
        strokeWidth: 2,
        fillColor: countyColor,
        fillOpacity: 0.20,
        label: countyNameLabel,
        labelOutlineColor: countyColor,
        labelOutlineWidth: 2,
        fontSize: 14,
        fontColor: "#fff",
        fontOpacity: 0.85,
        fontWeight: "bold"  
    };
    
    var attributes = {
        name: countyName,
        number: countyNumber
    };
    
    var pnt= [];
    for(i=0;i<countyPoints.length;i++){
        convPoint = new OpenLayers.Geometry.Point(countyPoints[i].lon,countyPoints[i].lat).transform(new OpenLayers.Projection("EPSG:4326"), gac_Map.getProjectionObject());
        //console.log('GACounty: ' + JSON.stringify(countyPoints[i]) + ', ' + countyPoints[i].lon + ', ' + countyPoints[i].lat);
        pnt.push(convPoint);
    }
		       
    var ring = new gac_OL.Geometry.LinearRing(pnt);
    var polygon = new gac_OL.Geometry.Polygon([ring]);
    
    var feature = new gac_OL.Feature.Vector(polygon,attributes,style);
    countyLayer.addFeatures([feature]);

}

function CurrentCountyLocation(county_mapLayer){
    var gac_Map = unsafeWindow.Waze.map;

    for(i=0;i<county_mapLayer.features.length;i++){
        var countyMapCenter = gac_Map.getCenter();
        var countyCenterPoint = new OpenLayers.Geometry.Point(countyMapCenter.lon,countyMapCenter.lat);
        var countyCenterCheck = county_mapLayer.features[i].geometry.components[0].containsPoint(countyCenterPoint);
        //console.log('GACounty: ' + county_mapLayer.features[i].attributes.number + ': ' + countyCenterCheck);
        if(countyCenterCheck === true){
        	var countyLocationLabel = 'County: ' + county_mapLayer.features[i].attributes.number + ', City: ' + $('.WazeControlLocationInfo').text();
    		setTimeout(function(){$('.WazeControlLocationInfo').text(countyLocationLabel)},200);
        }
    }
}

